/*Table structure for table `currencies` */

DROP TABLE IF EXISTS `currencies`;

CREATE TABLE `currencies` (
  `currency_code` varchar(3) NOT NULL,
  `currency_name` varchar(100) NOT NULL,
  `currency_symbol` varchar(100) DEFAULT NULL,
  `active` char(1) NOT NULL DEFAULT '1',
  KEY `country_id` (`currency_code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `currencies` */

insert  into `currencies`(`currency_code`,`currency_name`,`currency_symbol`,`active`) values ('USD','US Dollars','$','1'),('HTG','Groude','G','1');

/*Table structure for table `deduction_types` */

DROP TABLE IF EXISTS `deduction_types`;

CREATE TABLE `deduction_types` (
  `deduction_type_id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL,
  `order` int(11) NOT NULL,
  `deduction_type` varchar(100) NOT NULL,
  `is_amount` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'is amount or percentage',
  `status` char(1) DEFAULT '1',
  PRIMARY KEY (`deduction_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

/*Data for the table `deduction_types` */

insert  into `deduction_types`(`deduction_type_id`,`company_id`,`order`,`deduction_type`,`is_amount`,`status`) values (1,1,1,'Health Insurance (International)',1,'1'),(2,1,2,'Pension',1,'1'),(3,1,0,'Loan',1,'1'),(4,1,0,'Health Insurance',0,'1');

/*Table structure for table `departments` */

DROP TABLE IF EXISTS `departments`;

CREATE TABLE `departments` (
  `department_id` int(11) NOT NULL AUTO_INCREMENT,
  `department_name` varchar(50) NOT NULL,
  `company_id` int(11) NOT NULL DEFAULT '1',
  `status` char(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`department_id`),
  KEY `company_id` (`company_id`),
  CONSTRAINT `departments_ibfk_1` FOREIGN KEY (`company_id`) REFERENCES `companies` (`company_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

