/*Table structure for table `employment_types` */

DROP TABLE IF EXISTS `employment_types`;

CREATE TABLE `employment_types` (
  `status_type_id` int(11) NOT NULL AUTO_INCREMENT,
  `status_type_name` varchar(100) NOT NULL,
  `company_id` int(11) NOT NULL,
  `status` char(1) DEFAULT '1',
  PRIMARY KEY (`status_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

/*Data for the table `employment_types` */

insert  into `employment_types`(`status_type_id`,`status_type_name`,`company_id`,`status`) values (1,'FullTime',1,'1'),(2,'Internship-Trainee',1,'1'),(3,'Contractor-PartTime',1,'1'),(4,'Daily Contractor',1,'1');

/*Table structure for table `exchange_rates` */

DROP TABLE IF EXISTS `exchange_rates`;

CREATE TABLE `exchange_rates` (
